	add("philately", "{\"term\":\"philately\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"1865, from French {{m|fr|philatélie}}, coined by French stamp collector Georges Herpin (in \u0027Le Collectionneur de Timbres-poste,\u0027 Nov. 15, 1864) from Ancient greek (to 1453) \u0027φιλέω|lang\u003dgrc\u0027 () + \u0027ἀτέλεια\u0027 the closest word he could find in Ancient Greek to the concept of \u0026quot;postage stamp\u0026quot;, from \u0027lang\u003dgrc|ἀ-\u0027 () + \u0027lang\u003dgrc|τέλος\u0027 () This word serves as a reminder of the original function of postage stamps, now often forgotten: the cost of letter-carrying formerly was paid by the recipient; stamps indicated it had been pre-paid by the sender, thus the letters were \u0026quot;carriage-free\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Stamp collecting\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The study of postage stamps, postal routes, postal history, etc\", \"priority\":2}]}, \"synonyms\":{}}");

