	add("philosopheme", "{\"term\":\"philosopheme\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"Borrowed from the Ancient greek (to 1453) \u0027φιλοσόφημα\u0027 (syllogism) via Latin \u0027lang\u003dla|philosophema\u0027 () The Greek was formed from \u0027φιλοσοφέω\u0027 (to philosophize or pursue knowledge) and the nominalizing suffix \u0027-μα\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A philosophical statement, theorem or axiom\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1825\u0027\u0027, w:Samuel Taylor Samuel Taylor Coleridge, \u0027[http://books.google.com/books?id\u003dIA8LAAAAYAAJ\u0026amp;pg\u003dPA335 Prometheus of Aeschylus\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"This, the most venerable, and perhaps the most ancient, of Grecian \u0027mythi\u0027, is a \u0027\u0027philosopheme\", \"priority\":3}]}, \"synonyms\":{}}");

	add("philosopher", "{\"term\":\"philosopher\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman or Middle french (ca. 1400-1600) {{m|frm|philosophe}}, from Latin {{m|la|philosophus}}, from Ancient greek (to 1453) {{m|grc|φιλόσοφος||lit\u003dlover of wisdom}} + {{m|en|-er}}.Credited as having been coined by {{w|Pythagoras}} to describe himself.\u0026lt;ref\u0026gt;Attributed dates to Roman antiquity: {{w|Cicero}}, \u0027{{w|Tusculan Disputations}}\u0027, 5.3.8-9 \u003d {{w|Heraclides Ponticus}} fr. 88 Wehrli, {{w|Diogenes Laertius}} 1.12, 8.8, {{w|Iamblichus}} \u0027VP\u0027 58.\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;This view has been challenged by {{w|Walter Burkert}}, but it has been defended by C.J. De Vogel, \u0027Pythagoras and Early Pythagoreanism\u0027 (1966), pp. 97–102, and C. Riedweg, \u0027Pythagoras: His Life, Teaching, And Influence\u0027 (2005), p. 92.\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person devoted to studying and producing results in philosophy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, \u0027Bloom\u0027s Modern Critical Views: Stephen King\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Their playwrights knew better. Scandal, murder, hair-rending and railing against the gods sold tickets. King is not a \u0027\u0027philosopher\u0027\u0027. He knows how to sell tickets\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"This is not the sort of happiness which a man would in general wish to owe to his wife; but where other powers of entertainment are wanting, the true \u0027\u0027philosopher\u0027\u0027 will derive benefit from such as are given\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An alchemist\", \"priority\":5}]}, \"synonyms\":{}}");

	add("philosophy", "{\"term\":\"philosophy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman {{m|fro|philosophie}}, Old french (842-ca. 1400) {{m|fro|philosophie}}, and their source, Latin {{m|la|philosophia}}, from Ancient greek (to 1453) {{m|grc|φιλοσοφία}}, from {{m|grc|φίλος||beloved}} + {{m|grc|σοφία||wisdom}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The love of wisdom\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An academic discipline that seeks truth through reasoning rather than empiricism\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1661\u0027\u0027, \u0027[http://archive.org/stream/a615775104worduoft/a615775104worduoft_djvu.txt The Life of the most learned, reverend and pious Dr. H. Hammond\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"During the whole time of his abode in the university he generally spent thirteen hours of the day in study; by which assiduity besides an exact dispatch of the whole course of \u0027\u0027philosophy\u0027\u0027, he read over in a manner all classic authors that are extan\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A comprehensive system of belief\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A view or outlook regarding fundamental principles underlying some domain\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A general principle (usually moral\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A broader branch of (non-applied) science\", \"priority\":8}]}, \"synonyms\":{}}");

	add("philtrum", "{\"term\":\"philtrum\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From the \u0027philtrum\u0027 from Ancient greek (to 1453) \u0027φίλτρον\u0027 from \u0027φιλέω\u0027 (to love, to kiss)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The shallow groove running down the center of the outer surface of the upper lip\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, M. L. Kulkarni, \u0027Clinical Methods in Paediatrics: Physical Examination of Children\u0027, Jaypee Brothers Medical Publishers, India, [http://books.google.com.au/books?id\u003dlbKdH4WSzFsC\u0026amp;pg\u003dPA142\u0026amp;dq\u003d%22philtrum%22%7C%22philtra%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dsFw0UfTwNMrsmAXU-ICYBg\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22philtrum%22%7C%22philtra%22\u0026amp;f\u003dfalse page 142\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Oral intercommissural distance (mouth width) and \u0027\u0027philtrum\u0027\u0027 length are useful measurements for diagnosis of wide or large mouth (macrostomia), small mouth (microstomia), long \u0027\u0027philtrum\u0027\u0027 and short \u0027\u0027philtrum\u0027\u0027 and form ‘good handles’ in syndromic delineation\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Loren J. Borud, Arin K. Greene, \u0027Chapter 24: Lip Reconstruction\u0027, Josef E. Fischer, Kirby I. Bland, et al. (editors), \u0027Mastery of Surgery\u0027, Volume 1, 5th Edition, [http://books.google.com.au/books?id\u003dPgUFJg_-f4YC\u0026amp;pg\u003dPA301\u0026amp;dq\u003d%22philtrum%22%7C%22philtra%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dsFw0UfTwNMrsmAXU-ICYBg\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22philtrum%22%7C%22philtra%22\u0026amp;f\u003dfalse page 301\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Upper lip reconstruction is more difficult than lower lip reconstruction because the upper lip has a central structure, the \u0027\u0027philtrum\u0027\u0027.Wounds adjacent to the \u0027\u0027philtrum\u0027\u0027 that are closed primarily may shift the \u0027\u0027philtrum\u0027\u0027 to the affected side. However, with time, the \u0027\u0027philtrum\u0027\u0027 will tend to return to its midline position\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Hrishikesh Dubey, \u0027Mysteries of Vedic Face Reading\u0027, [http://books.google.com.au/books?id\u003dcObWJt-CetAC\u0026amp;pg\u003dPT166\u0026amp;dq\u003d%22philtrum%22%7C%22philtra%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dsFw0UfTwNMrsmAXU-ICYBg\u0026amp;redir_esc\u003dy unnumbered page\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"If the \u0027\u0027philtrum\u0027\u0027 is long and deep, then these people are very romantic, sexual, lively and friendly\", \"priority\":9}]}, \"synonyms\":{}}");

	add("phimosis", "{\"term\":\"phimosis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027phimosis\u0027 from Ancient greek (to 1453) \u0027φίμωσις\u0027 (muzzling)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A contraction of the foreskin (either as a stage of development or a pathological condition), which prevents it from being retracted\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1762\u0027\u0027, Laurence Sterne, \u0027The Life \u0026amp; Opinions of Tristram Shandy, Gentleman\u0027, Penguin 2003, p. 361\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"’Twill end in a \u0027\u0027\u0027phimosis\u0027\u0027\u0027, replied Dr. \u0027Slop\", \"priority\":3}]}, \"synonyms\":{}}");

