	add("phishing", "{\"term\":\"phishing\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Respelling of \u0027fishing\u0027 () In Usenet newsgroups, cracker and pirate groups used variant spellings of \u0027phish\u0027 and \u0027warez\u0027 (i.e. \u0027wares\u0027) to evade scans and filters by mainstream servers policing the ARPAnet/Internet.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of sending email that falsely claims to be from a legitimate organization. This is usually combined with a threat or request for information: for example, that an account will close, a balance is due, or information is missing from an account. The email will ask the recipient to supply confidential information, such as bank account details, PINs or passwords; these details are then used by the owners of the website to conduct fraud\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act of circumventing security with an alias\", \"priority\":2}]}, \"synonyms\":{}}");

